import s from './Home.module.css';

class SocialIcon extends React.Component {

    socImages =[
        { facebook: '' },
        { iconSrc: 'https://www.instagram.com/static/images/ico/favicon-200.png/ab6eff595bb1.png', iconAlt: 'instagram' },
        { iconSrc: 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/91/Octicons-mark-github.svg/1200px-Octicons-mark-github.svg.png', iconAlt: 'github' },
        { iconSrc: '', iconAlt: 'gmail' },
        { iconAlt: 'youtube' },

    ]


    render() {
        debugger;
        return (
            <div className={s.body}>
                <a href="#"><img src={this.state[0, 1, 2, 3, 4]} alt={'na xer'} /></a>
            </div>
        );
    }
}

export default SocialIcon;
